INSERT INTO `templates` VALUES ('forecast','Уважаемый {{ user.full_name }}\n\nУведомляем Вас о сроках действия услуг:\n\n{{ FOR item IN user.pays.forecast.items }}\n- Услуга: {{ item.name }}\n  Стоимость: {{ item.total }} руб.\n  {{ IF item.expire }}\n  Истекает: {{ item.expire }}\n  {{ END }}\n{{ END }}\n\n{{ IF user.pays.forecast.dept }}\nПогашение задолженности: {{ user.pays.forecast.dept }} руб.\n{{ END }}\n\nИтого к оплате: {{ user.pays.forecast.total }} руб.\n\nУслуги, которые не будут оплачены до срока их истечения, будут приостановлены.\n\nПодробную информацию по Вашим услугам Вы можете посмотреть в вашем личном кабинете: {{ config.api.url }}\n\nЭто письмо сформировано автоматически. Если оно попало к Вам по ошибке,\nпожалуйста, сообщите об этом нам: {{ config.mail.from }}',NULL),('get_marzban_token','get_marzban_token() {\n    if [ -f \"/opt/marzban/.env\" ]; then\n        export $(grep \'^SUDO_USERNAME\' /opt/marzban/.env | sed \'s/ //g;s/\"//g\')\n        export $(grep \'^SUDO_PASSWORD\' /opt/marzban/.env | sed \'s/ //g;s/\"//g\')\n        export $(grep \'^UVICORN_PORT\' /opt/marzban/.env | sed \'s/ //g;s/\"//g\')\n\n        if [[ $(grep \'^UVICORN_SSL_CERTFILE\' /opt/marzban/.env) ]]; then\n            export MARZBAN_HOST=\"https://127.0.0.1:$UVICORN_PORT\"\n        else\n            export MARZBAN_HOST=\"http://127.0.0.1:$UVICORN_PORT\"\n        fi\n\n        echo \"Marzban host: $MARZBAN_HOST\"\n\n        [ -z \"$SUDO_USERNAME\" ] && echo \'Error: SUDO_USERNAME not defined in /opt/marzban/.env\' && exit 1\n        [ -z \"$SUDO_PASSWORD\" ] && echo \'Error: SUDO_PASSWORD not defined in /opt/marzban/.env\' && exit 1\n\n        export TOKEN=$(curl -sk -XPOST \\\n          \"$MARZBAN_HOST/api/admin/token\" \\\n          -H \'Content-Type: application/x-www-form-urlencoded\' \\\n          -d \"grant_type=password&username=$SUDO_USERNAME&password=$SUDO_PASSWORD\" | jq -r .access_token)\n\n        if [ -z \"$TOKEN\" ]; then\n            echo \'Error: can not get TOKEN. Please check docker containers status\'\n            exit 1\n        fi\n    else\n        echo \'Error: Marzban has not been installed yet\'\n        exit 1\n    fi\n}',NULL),('marzban','#!/bin/bash\n\nexport SUBSCRIPTION_DOMAIN=\"{{ server.settings.subscription_domain }}\"\nexport EMAIL_FOR_CERTIFICATE_ISSUE=\"{{ config.acme.email_for_certificate_issue }}\"\n\nEVENT=\"{{ event_name }}\"\nSESSION_ID=\"{{ user.gen_session.id }}\"\nAPI_URL=\"{{ config.api.url }}\"\n\necho \"Marzban Template v1\"\necho\necho \"EVENT=$EVENT\"\n\nget_marzban_token() {\n    if [ -f \"/opt/marzban/.env\" ]; then\n        export $(grep \'^SUDO_USERNAME\' /opt/marzban/.env | sed \'s/ //g;s/\"//g\')\n        export $(grep \'^SUDO_PASSWORD\' /opt/marzban/.env | sed \'s/ //g;s/\"//g\')\n        export $(grep \'^UVICORN_PORT\' /opt/marzban/.env | sed \'s/ //g;s/\"//g\')\n\n        if [[ $(grep \'^UVICORN_SSL_CERTFILE\' /opt/marzban/.env) ]]; then\n            export MARZBAN_HOST=\"https://127.0.0.1:$UVICORN_PORT\"\n        else\n            export MARZBAN_HOST=\"http://127.0.0.1:$UVICORN_PORT\"\n        fi\n\n        echo \"Marzban host: $MARZBAN_HOST\"\n\n        [ -z \"$SUDO_USERNAME\" ] && echo \'Error: SUDO_USERNAME not defined in /opt/marzban/.env\' && exit 1\n        [ -z \"$SUDO_PASSWORD\" ] && echo \'Error: SUDO_PASSWORD not defined in /opt/marzban/.env\' && exit 1\n\n        export TOKEN=$(curl -sk -XPOST \\\n          \"$MARZBAN_HOST/api/admin/token\" \\\n          -H \'Content-Type: application/x-www-form-urlencoded\' \\\n          -d \"grant_type=password&username=$SUDO_USERNAME&password=$SUDO_PASSWORD\" | jq -r .access_token)\n\n        if [ -z \"$TOKEN\" ]; then\n            echo \'Error: can not get TOKEN. Please check docker containers status\'\n            exit 1\n        fi\n    else\n        echo \'Error: Marzban has not been installed yet\'\n        exit 1\n    fi\n}\n\ncase $EVENT in\n    INIT)\n        export SERVER_HOST=\"{{ server.host.remove(\'.*@\') }}\"\n        if [ -z $SERVER_HOST ]; then\n            echo \"ERROR: can\'t get server host\"\n            exit 1\n        fi\n\n        echo \"Install required packages\"\n        apt-get update\n        apt-get install -y \\\n            curl \\\n            pwgen \\\n            net-tools \\\n            socat \\\n            jq\n\n        echo \"Install Marzban...\"\n        export SUDO_USERNAME=admin\n        export SUDO_PASSWORD=$(pwgen -n 16 -1)\n        bash -c \"$(curl -sL https://github.com/danuk/shm-templates/raw/main/marzban/marzban.sh)\" @ install\n        echo \"done\"\n        echo\n\n        echo \"Setup Marzban...\"\n        sleep 5\n        get_marzban_token\n        bash -c \"$(curl -sL https://github.com/danuk/shm-templates/raw/main/marzban/marzban-setup.sh)\"\n        echo \"done\"\n\n        echo \"Check SHM API host: $API_URL\"\n        HTTP_CODE=$(curl -sk -o /dev/null -w \"%{http_code}\" $API_URL/shm/v1/test)\n        RET_CODE=$?\n        if [ $RET_CODE -ne 0 ]; then\n            echo \"Error: host $API_URL is incorrect.\"\n            echo \"Please set correct public host in SHM config. It must be accessible from the server.\"\n            exit 1\n        fi\n        if [ $HTTP_CODE -ne \'200\' ]; then\n            echo \"ERROR: incorrect API URL: $API_URL\"\n            echo \"Got status: $HTTP_CODE\"\n            exit 1\n        fi\n        ;;\n    CREATE)\n        echo \"Create a new user\"\n        expire_datetwentyonemin=$(date +\'%Y-%m-%d %T\' --date=\"{{ us.expire }} 21 minutes\")\n        expire_date=$(date --date=\"$expire_datetwentyonemin\" \'+%s\')\nPAYLOAD=\"$(cat <<-EOF\n{\n  \"username\": \"us_{{ us.id }}\",\n  \"proxies\": {\n    \"vless\": {\"flow\": \"xtls-rprx-vision\"}\n  },\n  \"data_limit\": 0,\n  \"expire\": $expire_date,\n  \"data_limit_reset_strategy\": \"no_reset\",\n  \"status\": \"active\",\n  \"note\": \"SHM_info- {{ user.login }}, {{ user.full_name }}, https://t.me/{{ user.settings.telegram.login }}\",\n  \"inbounds\": {\n    \"vless\": [\n      \"VLESS TCP REALITY\"\n    ]\n  }\n}\nEOF\n)\"\n\n        get_marzban_token\n        USER_CFG=$(curl -sk -XPOST \\\n          \"$MARZBAN_HOST/api/user\" \\\n          -H \"Authorization: Bearer $TOKEN\" \\\n          -H \'Content-Type: application/json\' \\\n          -d \"$PAYLOAD\")\n\n        if [ -z $(echo \"$USER_CFG\" | jq -r \'.username | select( . != null )\') ]; then\n            echo \"Error: $USER_CFG\"\n            exit 1\n        fi\n\n        echo \"Upload user config to SHM: $API_URL/shm/v1/storage/manage/vpn_mrzb_{{ us.id }}\"\n        curl -sk -XPUT \\\n            -H \"session-id: $SESSION_ID\" \\\n            -H \"Content-Type: application/json\" \\\n            $API_URL/shm/v1/storage/manage/vpn_mrzb_{{ us.id }} \\\n            --data-binary \"$USER_CFG\"\n        echo \"done\"\n        ;;\n    ACTIVATE)\n        echo \"Activate user\"\n        expire_datetwentyonemin=$(date +\'%Y-%m-%d %T\' --date=\"{{ us.expire }} 21 minutes\")\n        expire_date=$(date --date=\"$expire_datetwentyonemin\" \'+%s\')\n\n        get_marzban_token\n        curl -sk -XPUT \\\n          \"$MARZBAN_HOST/api/user/us_{{ us.id }}\" \\\n          -H \"Authorization: Bearer $TOKEN\" \\\n          -H \'Content-Type: application/json\' \\\n          -d \'{\"expire\":\'$expire_date\'}\'\n          -d \'{\"status\":\"active\"}\'\n\n        echo \"done\"\n        ;;\n    BLOCK)\n        echo \"Block user\"\n\n        get_marzban_token\n        curl -sk -XPUT \\\n          \"$MARZBAN_HOST/api/user/us_{{ us.id }}\" \\\n          -H \"Authorization: Bearer $TOKEN\" \\\n          -H \'Content-Type: application/json\' \\\n          -d \'{\"status\":\"disabled\"}\'\n\n        echo \"done\"\n        ;;\n    REMOVE)\n        echo \"Remove user\"\n\n        get_marzban_token\n        curl -sk -XDELETE \\\n          \"$MARZBAN_HOST/api/user/us_{{ us.id }}\" \\\n          -H \"Authorization: Bearer $TOKEN\"\n\n        echo \"Remove user key from SHM\"\n        curl -sk -XDELETE \\\n            -H \"session-id: $SESSION_ID\" \\\n            $API_URL/shm/v1/storage/manage/vpn_mrzb_{{ us.id }}\n        echo \"done\"\n        ;;\n    PROLONGATE)\n        echo \"Reset user counters\"\n        expire_datetwentyonemin=$(date +\'%Y-%m-%d %T\' --date=\"{{ us.expire }} 21 minutes\")\n        expire_date=$(date --date=\"$expire_datetwentyonemin\" \'+%s\')\n\n        get_marzban_token\n        curl -sk -XPOST \\\n          \"$MARZBAN_HOST/api/user/us_{{ us.id }}/reset\" \\\n          -H \"Authorization: Bearer $TOKEN\"\n\n          curl -sk -XPUT \\\n          \"$MARZBAN_HOST/api/user/us_{{ us.id }}\" \\\n          -H \"Authorization: Bearer $TOKEN\" \\\n          -H \'Content-Type: application/json\' \\\n          -d \'{\"expire\":\'$expire_date\'}\'\n        echo \"done\"\n        ;;\n    *)\n        echo \"Unknown event: $EVENT. Exit.\"\n        exit 0\n        ;;\nesac',NULL),('message','https://admin.vpnushka.ru/shm/pay_systems/yookassa.cgi?user_id={{%20user.id%20}}&action=create&amount={{%20user.pays.forecast(%27blocked%27,1).total%20}}&message_id={{%20message.message_id%20+%201%20}}',NULL),('telegram_bot','<% SWITCH cmd %>\n<% CASE \'USER_NOT_FOUND\' %>\n{\n    \"shmRegister\": {\n        \"partner_id\": \"{{ args.0 }}\",\n        \"callback_data\": \"/start\",\n        \"error\": \"ОШИБКА: Логин {{ message.chat.username }} или chat_id {{ message.chat.id }} уже существует\"\n    }\n}\n<% CASE [\'/start\', \'/menu\', \'Меню\'] %>\n{{ IF cmd != \'/start\' }}\n{\n    \"deleteMessage\": { \"message_id\": {{ message.message_id }} }\n},\n{{ END }}\n{\n    \"sendMessage\": {\n        \"text\":\"Меню\",\n        \"parse_mode\": \"HTML\",\n        \"reply_markup\": {\n    \"keyboard\": [\n        [\n            {\"text\": \"О нас\",\"callback_data\": \"/faq\"}\n        ],\n        [\n            {\"text\": \"Баланс\", \"callback_data\": \"/balance\"},\n            {\"text\": \"Мои услуги\", \"callback_data\": \"/list\"}\n        ],\n        [\n            {\"text\": \"Реферальная система\", \"callback_data\": \"/referrals\"},\n            {\"text\": \"Помощь\", \"callback_data\": \"/help\"}\n        ]\n    ],\n            \"one_time_keyboard\": false,\n            \"resize_keyboard\": true\n        }\n    }\n},\n{\n    \"sendMessage\": {\n        \"text\": \"Создавайте и управляйте своими VPN-ключами\",\n        \"reply_markup\": {\n            \"inline_keyboard\": [\n                [\n                    {\n                        \"text\": \"💰 Баланс\",\n                        \"callback_data\": \"/balance\"\n                    }\n                ],\n                [\n                    {\n                        \"text\": \"🗝 Список VPN-ключей\",\n                        \"callback_data\": \"/list\"\n                    }\n                ],\n                [\n                    {\n                        \"text\": \"🤝 Реферальная система\",\n                        \"callback_data\": \"/referrals\"\n                    }\n                ],\n                [\n                    {\n                        \"text\": \"🗓 Помощь\",\n                        \"callback_data\": \"/help\"\n                    }\n                ]\n            ]\n        }\n    }\n}\n<% CASE [\'/balance\',\'Баланс\'] %>\n{\n    \"deleteMessage\": { \"message_id\": {{ message.message_id }} }\n},\n{\n    \"sendMessage\": {\n        \"text\": \"💰 <b>Баланс</b>: {{ user.balance }}\\n\\nНеобходимо оплатить: <b>{{ user.pays.forecast.total }}</b>\",\n        \"reply_markup\" : {\n            \"inline_keyboard\": [\n                [\n{\n                        \"text\": \"✚ Пополнить баланс\",\n                        \"web_app\": {\n                            \"url\": \"{{ config.api.url }}/shm/v1/template/tg_payments?format=html&session_id={{ user.gen_session.id }}\"\n                        }\n                    }\n                ],\n                [\n                    {\n                        \"text\": 