n    \"shmServiceOrder\": {\n        \"service_id\": \"{{ args.0 }}\",\n        \"callback_data\": \"/list\",\n        \"cb_not_enough_money\": \"/balance\",\n        \"error\": \"ОШИБКА\"\n    }\n}\n<% CASE \'/download_qr\' %>\n{\n    \"uploadDocumentFromStorage\": {\n        \"name\": \"vpn{{ args.0 }}\",\n        \"filename\": \"vpn{{ args.0 }}.conf\"\n    }\n}\n<% CASE \'/show_qr\' %>\n{\n    \"uploadPhotoFromStorage\": {\n        \"name\": \"vpn{{ args.0 }}\",\n        \"format\": \"qr_code_png\"\n    }\n}\n<% CASE \'/delete\' %>\n{\n    \"deleteMessage\": { \"message_id\": {{ message.message_id }} }\n},\n{\n    \"sendMessage\": {\n        \"text\": \"🤔 <b>Подтвердите удаление услуги. Услугу нельзя будет восстановить!</b>\",\n        \"reply_markup\" : {\n            \"inline_keyboard\": [\n                [\n                    {\n                        \"text\": \"🧨 ДА, УДАЛИТЬ! 🔥\",\n                        \"callback_data\": \"/delete_confirmed {{ args.0 }}\"\n                    }\n                ],\n                [\n                    {\n                        \"text\": \"⇦ Назад\",\n                        \"callback_data\": \"/list\"\n                    }\n                ]\n            ]\n        }\n    }\n}\n<% CASE \'/delete_confirmed\' %>\n{\n    \"deleteMessage\": { \"message_id\": {{ message.message_id }} }\n},\n{\n    \"shmServiceDelete\": {\n        \"usi\": \"{{ args.0 }}\",\n        \"callback_data\": \"/list\",\n        \"error\": \"ОШИБКА\"\n    }\n}\n<% CASE [\'/help\',\'Помощь\'] %>\n{\n    \"deleteMessage\": { \"message_id\": {{ message.message_id }} }\n},\n{\n    \"sendPhoto\": {\n        \"photo\": \"https://i.ibb.co/7YHDM1Z/FAQ-Group.png\",\n        \"protect_content\": \"true\",\n        \"parse_mode\":\"HTML\",\n        \"caption\": \"Для удобства наших пользователей мы собрали ответы на частые вопросы в нашем Telegram-канале. Если вы не нашли нужную информацию там, наша техническая поддержка всегда готова помочь. Свяжитесь с 