редлагаем одни из самых низких цен на рынке 💰 — и это еще не все! Мы также покрываем комиссию с платежей 🏦, так что вам не нужно переживать о дополнительных расходах. У нас действительно выгодно!\\n\\nНаш сервис совместим с любыми устройствами и операционными системами 💻📱, а простота подключения и профессиональная техническая поддержка обеспечат вам комфортное и безопасное использование VPN. С нами ваш интернет-серфинг будет под надежной защитой 🌐!\",\n        \"reply_markup\" : {\n            \"inline_keyboard\": [\n                [\n                    {\n                        \"text\": \"Поддержать проект\",\n                        \"url\": \"https://yoomoney.ru/to/4100118812793646\"\n                    }\n                ]\n            ]\n        }\n    }\n}\n<% CASE [\'/referrals\',\'Реферальная система\'] %>\n{\n    \"sendMessage\": {\n        \"text\": \"🤝 Партнёрская программа\\n\\nПриводи друзей и зарабатывай {{ config.billing.partner.income_percent }}% с их пополнений\\n\\n⬇️️ Твоя реферальная ссылка:\\n└ https://t.me/vpnushka_bot?start={{ user.id }}\\n\\n🏅 Статистика:\\n├ Приведено друзей: {{ user.referrals_count }}\\n└ Доступно к выводу: {{ user.get_bonus }} ₽\",\n        \"reply_markup\": {\n        }\n    }\n}\n<% CASE \'/show_mz_keys\' %>\n{{ subscription_url = storage.read(\'name\',\'vpn_mrzb_\' _ args.0 ).subscription_url }}\n{\n    \"printQrCode\": {\n        \"data\": \"{{ subscription_url }}\",\n        \"parameters\": {\n            \"parse_mode\": \"HTML\",\n            \"caption\": \"<b>Subscription URL:</b>\\n<code>{{ subscription_url }}</code>\"\n        }\n    }\n}\n<% CASE \'/show_instructions\' %>\n{\n    \"deleteMessage\": { \"message_id\": {{ message.message_id }} }\n},\n{\n    \"sendMessage\": {\n        \"text\": \"📘 <b>Инструкция по подключению VPN</b>\\n\\n<b>Для iOS:</b>\\n1. Установите приложение Streisand по ссылке: <a href=\'https://apps.apple.com/us/app/streisand/id6450534064?platform=iphone\'>Streisand для iOS</a>.\\n2. Отсканируйте QR-код или скопируйте ссылку подписки.\\n3. Вставьте ссылку в приложение Streisand.\\n\\n<b>Для Android:</b>\\n1. Установите приложение v2ray по ссылке: <a href=\'https://play.google.com/store/apps/details?id=com.v2ray.ang&hl=en_US&pli=1\'>v2ray для Android</a>.\\n2. Отсканируйте QR-код или скопируйте ссылку подписки.\\n3. Вставьте ссылку в приложение v2ray.\\n\\n<b>Для ПК:</b>\\n1. Установите приложение Hiddify с сайта: <a href=\'https://hiddify.com/\'>Hiddify</a>.\\n2. Отсканируйте QR-код или скопируйте ссылку подписки.\\n3. Вставьте ссылку в приложение Hiddify.\\n\\n<b>Альтернативный способ для iOS и Android:</b>\\nЕсли у вас уже установлено приложение Streisand (iOS) или v2ray (Android), перейдите по ссылке подписки и нажмите \'Добавить\' в соответствующем приложении.\",\n        \"parse_mode\": \"HTML\",\n        \"reply_markup\" : {\n            \"inline_keyboard\": [\n                [\n                    {\n                        \"text\": \"⇦ Назад\",\n                        \"callback_data\": \"/service {{ args.0 }}\"\n                    }\n                ]\n            ]\n        }\n    }\n}\n<% END %>',NULL),('tg_payments','{{ IF request.params.uid }}\n{{ user = user.switch( request.params.uid ) }}\n{{ END }}\n<!DOCTYPE html>\n<html lang=\"ru\">\n<head>\n    <meta charset=\"utf-8\">\n    <meta name=\"viewport\"\n          content=\"width=device-width, initial-scale=1.0, minimum-scale=1.0, maximum-scale=1.0, user-scalable=no\"/>\n    <meta name=\"format-detection\" content=\"telephone=no\"/>\n    <meta http-equiv=\"X-UA-Compatible\" content=\"IE=edge\"/>\n    <meta name=\"MobileOptimized\" content=\"176\"/>\n    <meta name=\"HandheldFriendly\" content=\"True\"/>\n    <meta name=\"robots\" content=\"noindex,nofollow\"/>\n    <title></title>\n    <script src=\"https://telegram.org/js/telegram-web-app.js?1\"></script>\n    <style>\n        body {\n            --bg-color: var(--tg-theme-bg-color, #fff);\n            font-family: sans-serif;\n            background-color: var(--bg-color);\n            color: var(--tg-theme-text-color, #222);\n            font-size: 14px;\n            margin: 0;\n            padding: 0;\n            color-scheme: var(--tg-color-scheme);\n        }\n\n        .btn {\n            font-size: 14px;\n            padding: 10px 17px;\n        }\n\n        .btn-primary {\n            background-color: var(--tg-theme-button-color, #50a8eb);\n            color: var(--tg-theme-button-text-color, #fff);\n            border: none;\n        }\n\n        .button-container {\n            display: flex;\n        }\n\n        button {\n            display: block;\n            width: 100%;\n            font-size: 14px;\n            margin: 5px 0;\n            padding: 12px 20px;\n            border: none;\n            border-radius: 4px;\n            background-color: var(--tg-theme-button-color, #50a8eb);\n            color: var(--tg-theme-button-text-color, #ffffff);\n            cursor: pointer;\n        }\n\n        button.remove {\n            width: 40px;\n            padding: 10px;\n            margin-left: 10px;\n            background-color: red;\n        }\n\n        .main-container {\n            padding: 15px;\n        }\n\n        button[disabled] {\n            opacity: 0.6;\n            cursor: auto;\n            pointer-events: none;\n        }\n\n        button.close_btn {\n            /*position: fixed;*/\n            position: absolute;\n            left: 0;\n            right: 0;\n            bottom: 0;\n            border-radius: 0;\n            margin: 0;\n            padding: 16px 20px;\n            text-transform: uppercase;\n        }\n\n        input[type=\"number\"],\n        .input[contenteditable] {\n            display: block;\n            box-sizing: border-box;\n            font-size: 14px;\n            width: 100%;\n            padding: 12px 20px;\n            margin: 15px 0;\n            border: 1px solid var(--tg-theme-link-color, #000);\n            background-color: var(--tg-theme-bg-color, #ffffff);\n            border-radius: 4px;\n            color: var(--tg-theme-text-color, #222222);\n            text-align: start;\n        }\n\n        input[type=\"number\"]::-webkit-input-placeholder {\n            color: var(--tg-theme-hint-color, #ccc);\n        }\n\n        input[type=\"number\"]::-moz-placeholder {\n            color: var(--tg-theme-hint-color, #ccc);\n        }\n\n        input[type=\"number\"]:-ms-input-placeholder {\n            color: var(--tg-theme-hint-color, #ccc);\n        }\n\n        .input[data-placeholder] {\n            position: relative;\n        }\n\n        .input[data-placeholder]:empty:before {\n            position: absolute;\n            left: 0;\n            right: 0;\n            content: attr(data-placeholder);\n            color: var(--tg-theme-hint-color, #ccc);\n            padding: 0 20px;\n            font-weight: normal;\n            white-space: nowrap;\n            text-overflow: ellipsis;\n            overflow: hidden;\n            pointer-events: none;\n            z-index: -1;\n        }\n\n        section {\n            padding: 15px;\n            text-align: center;\n            background-color: var(--bg-color, #ffffff);\n        }\n\n        section .sect_row {\n            margin: 10px 0;\n        }\n\n        section + section {\n            padding: 0 15px 65px;\n        }\n\n        p {\n            margin: 40px 0 15px;\n        }\n    </style>\n</head>\n\n<body class=\"\" style=\"visibility: hidden;\">\n\n<section class=\"main-container\">\n    <h2>Оплата подписки</h2>\n    <h4>Ваш баланс: {{ user.balance }}</h4>\n    <h4 style=\"text-align:left;\">Сумма к оплате:</h4>\n    <input\n        type=\"number\"\n        step=\"0.01\"\n        min=\"1\"\n        class=\"input\"\n        value=\"\"\n        id=\"text_amount\"\n        placeholder=\"введите сумму к оплате\"\n        inputmode=\"numeric\" \\\n        pattern=\"\\d*\"\n        required\n    />\n</section>\n\n<section id=\"main_section\">\n    <h4 style=\"text-align:left;\">Выберите способ оплаты:</h4>\n\n{{ FOR item IN ref(pay.paysystems) }}\n    <div class=\"button-container\" id=\'{{ item.shm_url }}\'>\n        <button onclick=\"ShmPayApp.makePayment(\'{{ item.shm_url }}\',\'{{ item.recurring }}\');\">{{ item.name }}</button>\n        {{ IF item.recurring }}\n        <button onclick=\"ShmPayApp.removePayment(\'{{ item.shm_url }}\',\'{{ user.gen_session.id }}\');\" class=\"remove\">Х</button>\n        {{ END }}\n    </div>\n{{ END }}\n</section>\n\n<script type=\"application/javascript\">\n    const ShmPayApp = {\n        user_id       : {{ user.id }},\n        initData      : Telegram.WebApp.initData || \'\',\n        initDataUnsafe: Telegram.WebApp.initDataUnsafe || {},\n        MainButton    : Telegram.WebApp.MainButton,\n\n        init(options) {\n            document.body.style.visibility = \'\';\n            Telegram.WebApp.ready();\n            Telegram.WebApp.MainButton.setParams({\n                text      : \'Закрыть\',\n                is_visible: true\n            }).onClick(ShmPayApp.close);\n            Telegram.WebApp.expand();\n        },\n        expand() {\n            Telegram.WebApp.expand();\n        },\n        close() {\n            Telegram.WebApp.close();\n        },\n\n        makePayment(shm_url, recurring) {\n            var amount = document.getElementById(\'text_amount\').value;\n            if ( amount < 1 ) {\n                Telegram.WebApp.showAlert(\"Ошибка: Некоректная сумма к оплате\");\n                return;\n            };\n\n            if ( recurring == \'1\' ) {\n                Telegram.WebApp.MainButton.showProgress();\n                document.getElementById(\'main_section\').style.display = \'none\';\n\n                var xhr = new XMLHttpRequest();\n                xhr.open(\'GET\', shm_url + amount);\n                xhr.responseType = \'json\';\n\n                xhr.onload = function() {\n                    Telegram.WebApp.MainButton.hideProgress();\n                    if (xhr.status === 200) {\n                        Telegram.WebApp.showAlert( \"Платеж проведен успешно\" );\n                    } else {\n                        var jsonResponse = xhr.response;\n                        Telegram.WebApp.showAlert( \"Ошибка: \" + ( jsonResponse.msg_ru || jsonResponse.msg ) );\n                    }\n                    Telegram.WebApp.close();\n                }\n                xhr.send();\n            } else {\n                Telegram.WebApp.openLink( shm_url + amount, { try_instant_view: false } );\n                Telegram.WebApp.close();\n            }\n        },\n        removePayment(shm_url, session_id) {\n            Telegram.WebApp.showConfirm(\'Отвязать сохраненный способ оплаты?\', function(confirmed) {\n                if (!confirmed) return;\n\n                document.getElementById( shm_url ).style.display = \'none\';\n                var xhr = new XMLHttpRequest();\n                xhr.open(\'DELETE\', \'/shm/v1/user/autopayment\');\n                xhr.setRequestHeader(\'session-id\', session_id );\n                xhr.send();\n            });\n        },\n    }\n</script>\n\n<script type=\"application/javascript\">\n    document.getElementById(\'text_amount\').value = \"{{ request.params.amount || ref(pay.paysystems).0.amount }}\";\n    ShmPayApp.init();\n</script>\n\n</body>\n</html>',NULL),('user_password_reset','Уважаемый клиент.\n\nВаш новый пароль: {{ user.set_new_passwd }}\n\nАдрес кабинета: {{ config.cli.url }}','{\"subject\": \"SHM - Восстановление пароля\"}');
