  `settings` json DEFAULT NULL,
  `status_before` char(8) DEFAULT NULL,
  PRIMARY KEY (`user_service_id`),
  UNIQUE KEY `user_services_idx` (`user_service_id`,`user_id`,`service_id`),
  KEY `user_id` (`user_id`),
  KEY `service_id` (`service_id`),
  KEY `parent` (`parent`),
  KEY `withdraw_id` (`withdraw_id`),
  CONSTRAINT `user_services_ibfk_1` FOREIGN KEY (`user_id`) REFERENCES `users` (`user_id`),
  CONSTRAINT `user_services_ibfk_2` FOREIGN KEY (`service_id`) REFERENCES `services` (`service_id`),
  CONSTRAINT `user_services_ibfk_3` FOREIGN KEY (`parent`) REFERENCES `user_services` (`user_service_id`) ON DELETE SET NULL,
  CONSTRAINT `user_services_ibfk_4` FOREIGN KEY (`withdraw_id`) REFERENCES `withdraw_history` (`withdraw_id`)
) ENGINE=InnoDB AUTO_INCREMENT=199 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;
