  `comment` char(255) DEFAULT NULL,
  `dogovor` char(32) DEFAULT NULL,
  `block` tinyint NOT NULL DEFAULT '0',
  `gid` tinyint DEFAULT NULL,
  `perm_credit` tinyint DEFAULT '0',
  `full_name` char(255) DEFAULT NULL,
  `can_overdraft` tinyint DEFAULT '0',
  `bonus` decimal(10,2) NOT NULL,
  `phone` char(20) DEFAULT NULL,
  `verified` int DEFAULT NULL,
  `create_act` tinyint DEFAULT NULL,
  `settings` json DEFAULT NULL,
  PRIMARY KEY (`user_id`),
  UNIQUE KEY `users_uniq` (`login`)
